<template>
  <v-col sm="12" md="5" lg="4" xl="3" class="mt-9 ml-auto mr-auto">
    <v-container fluid class="work-space">
      <v-form ref="formUser" v-model="formValid">
        <v-row class="input-container px-2 py-2">
          <v-col cols="12" class="mb-4">
            <svg
              width="100%"
              height="100%"
              viewBox="0 0 335 239"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
              xmlns:xlink="http://www.w3.org/1999/xlink"
            >
              <rect width="335" height="239" fill="url(#pattern0)" />
              <defs>
                <pattern
                  id="pattern0"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use
                    xlink:href="#image0_16_113"
                    transform="translate(-0.0111643) scale(0.00129245 0.00181159)"
                  />
                </pattern>
                <image
                  id="image0_16_113"
                  width="791"
                  height="552"
                  xlink:href="data:image/png;base64,"
                />
              </defs>
            </svg>
          </v-col>
          <v-col cols="12" class="pb-0">
            <v-text-field
              hide-details="auto"
              background-color="#F3F3F3"
              rounded
              required
              :rules="nameRules"
              v-model="name"
              dense
              outlined
              placeholder="Họ và tên"
            />
          </v-col>
          <v-col cols="12" class="pb-0">
            <v-text-field
              hide-details="auto"
              background-color="#F3F3F3"
              class="phone-number"
              rounded
              required
              :rules="phoneRules"
              v-model="phoneNumber"
              type="number"
              dense
              outlined
              placeholder="Số điện thoại"
            />
          </v-col>
          <v-col cols="12" class="pb-4">
            <v-text-field
              hide-details="auto"
              background-color="#F3F3F3"
              rounded
              required
              :rules="emailRules"
              v-model="email"
              dense
              outlined
              placeholder="Email"
            />
          </v-col>
          <v-col cols="12">
            <v-btn
              width="100%"
              :disabled="!formValid"
              color="primary"
              rounded
              @click="nextPage('car-information')"
              >Tiếp tục
            </v-btn>
          </v-col>
        </v-row>
      </v-form>
    </v-container>
  </v-col>
</template>

<script>
export default {
  name: "UserInformation",
  data() {
    return {
      formValid: false,
      name: "",
      phoneNumber: "",
      email: "",
      nameRules: [
        (v) => !!v || "Tên không được trống",
        (v) => !!v || "Tên không được trống",
        (v) => v.length <= 50 || "Tên không được dài hơn 50 kí tự",
        (v) => v.length >= 2 || "Tên không được ngắn hơn 2 kí tự",
      ],
      phoneRules: [
        (v) => !!v || "SĐT không được trống",
        (v) => (v.length <= 11 && v.length >= 10) || "SĐT không hợp lệ",
      ],
      emailRules: [
        (v) => !!v || "Email không được trống",
        (v) =>
          !v ||
          /^\w+([.-]?\w+)*@\w+([.-]?\w+)*(\.\w{2,3})+$/.test(v) ||
          "Email không hợp lệ",
      ],
    };
  },
  created() {
    let userData = localStorage.getItem("UserData");
    if (userData) {
      userData = JSON.parse(userData);
      this.name = userData.name;
      this.email = userData.email;
      this.phoneNumber = userData.phone;
    }
  },
  methods: {
    nextPage(url) {
      this.$refs.formUser.validate();
      if (this.formValid) {
        localStorage.setItem(
          "UserData",
          JSON.stringify({
            name: this.name,
            phone: this.phoneNumber,
            email: this.email,
          })
        );
        this.$router.push(`/${url}`).catch();
      }
    },
  },
};
</script>

